CREATE TABLE `hanjas` (
  `id` integer primary key,
  `hanja` text,
  `hangul` text,
  `english` text,
  CONSTRAINT UC_Hanjas UNIQUE (hanja, hangul, english)
);

BEGIN;


COMMIT;

CREATE VIRTUAL TABLE `hanja_definition` USING fts3(
  `hanjas` text unique,
  `definition` text,
);

BEGIN;


COMMIT;

CREATE VIRTUAL TABLE `korean_pronunciation` USING fts3(
  `hanjas` text,
  `hangul` text unique
);

BEGIN;


COMMIT;

CREATE VIRTUAL TABLE `radicals` USING fts3(
  `radical` text unique,
  `hanjas` text
);

BEGIN;


COMMIT;
